import Vue from 'vue'
import Router from 'vue-router'
//定义路由组件
import Shouye from './views/shouye.vue'
import Booklist from './views/booklist'

Vue.use(Router)

export default new Router({
  mode:'history',
  routes: [
    {
      path:'/',
      redirect:'/shouye',
    },
    {
      // 匹配到/时，渲染home组件
      path: '/shouye',
      name: 'shouye',
      component: Shouye,
    },
    {
      // 匹配到/时，渲染home组件
      path: '/booklist',
      name: 'booklist',
      component: Booklist
    }
  ],
  linkActiveClass:'h'
})
